function Todo({todo, dispatch}) {
  return (
    <div>
      <span style={{color: todo.completed ? 'green' :'red'}}>
          {todo.name}</span>

      <button type="button" onClick={() => dispatch({
          type: ACTION.TOGGLE_TODO,
          payload : {
              id:todo.id
          } 
          })}> Toggle </button>
          <Button variant="outlined" startIcon={<DeleteIcon />} type="button" onClick={() => dispatch({
          type: ACTION.DELETE_TODO,
          payload : {
              id:todo.id
          } 
          })} >
        Delete
      </Button>
      {/* <button type="button" onClick={() => dispatch({
          type: ACTION.DELETE_TODO,
          payload : {
              id:todo.id
          } 
